    return newdate;

}

function run(inputVariable1, inputVariable2) {

    var inputSplit = [inputVariable1.split(":")]
    var hora = (inputSplit[0][0] * 1) + 1;

    if (hora < 10) {
        hora = "0" + hora;
    }

    var newHora = hora + ":" + inputSplit[0][1];

    if (newHora > '23:59') {
        newHora = '23:59'
    }

    return newHora;
}

function run(inputVariable1, inputVariable2) {

    var newTxt = JSON.parse(inputVariable1);
    var newItems = [newTxt.resource.items]
    var extra = []
    var usersIds = ''

    for (var i = 0; i < newItems[0].length; i++) {
        extra[i] = [newItems[0][i].extras.userid];
        usersIds += '\n' + extra[i];
    }

    return usersIds;
}
